import React from "react";

import { CustomButtonContainer } from "./custom-button.styles";

const CustomButton = ({
  children,
  isGoogleSignIn,
  inverted,
  ...otherProps
}) => (
  <CustomButtonContainer
    isGoogleSignIn={isGoogleSignIn}
    inverted={inverted}
    className="custom-button"
    {...otherProps}
  >
    {children}
  </CustomButtonContainer>
);

export default CustomButton;
